# 设置 Chrome 的无头模式选项
chrome_driver_path = r'/usr/local/bin/chromedriver'

# 配置 Chrome 无头浏览器选项
chrome_options = Options()
chrome_options.add_argument("--headless")  # 无头模式
chrome_options.add_argument("--no-sandbox")  # 禁用沙盒
chrome_options.add_argument("--disable-dev-shm-usage")  # 解决 /dev/shm 不足的问题
chrome_options.add_argument("--remote-debugging-port=9222")  # 远程调试端口，避免 DevToolsActivePort 问题

# 创建 Chrome 服务对象
service = Service(chrome_driver_path)

# 访问百度主页
wd = webdriver.Chrome(service=service, options=chrome_options)
wd.get('https://www.baidu.com')
time.sleep(10)

# 找到搜索框并输入 '123'
search_box = wd.find_element(By.ID, "kw")  # 百度搜索框的 ID 是 "kw"
search_box.send_keys('123')  # 输入要搜索的内容

# 提交搜索（模拟按下回车键）
search_box.send_keys(Keys.RETURN)

# 等待一会儿，确保页面加载完成
time.sleep(2)

# 打印搜索结果的标题
print(wd.title)

# 截图并保存
wd.save_screenshot('example.png')

# 关闭浏览器
wd.quit()

